import React from 'react'
import { Container, Col, Row, Navbar} from 'react-bootstrap'

const Sidebar = () => {
    return (
        <div className='side-bar'>
            <Col>
                <Row className='side-bar-menu'>
                    <a href="/">MenuA</a>
                </Row>
                <Row className='side-bar-menu'>
                    <a href="/">MenuB</a>
                </Row>
            </Col>
        </div>
    )
};

export default Sidebar;
